import React from 'react';
import logo from './logo.svg';
import './App.css';
// Header Component 
import styled from 'styled-components';
import Header from './components/Header';

// site title 
const Headline = styled.h1`
  font-size: 48px;
  margin: 15px 0 10px 0;
  padding: 0;
  @media screen and (min-width: 48em) {
    font-weight: 500;
    letter-spacing: -0.6px;
    line-height: 58px;
  }
`

function App() {
  return (
    <div className="App">
      <Header /> 
      <Headline>Google Developer Group El Paso</Headline>
      <h3>We are a group of students and industry professionals who share a love for coding and developing & we strive to share that passion with others!</h3>
    </div>
  );
}

export default App;
